// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "./SyndicateClosedEndFundLogic.sol";
import "./interfaces/ISyndicateClosedEndFundDepositTransferLogicV0.sol";

/// @author Syndicate Inc.
/// @notice Handle transferring member deposits between addresses
contract SyndicateClosedEndFundDepositTransferLogicV0 is
    ISyndicateClosedEndFundDepositTransferLogicV0,
    SyndicateClosedEndFundLogic
{
    // Storage------------------------------------------------------------------

    /// @notice Used to initialize the Syndicate contract.
    constructor(address owner, address storeAddress)
        SyndicateClosedEndFundLogic(owner, storeAddress)
    {}

    // Events-------------------------------------------------------------------

    /// @notice A manager updates the `transferable` field.
    event TransferableUpdated(
        address indexed syndicateAddress,
        bool transferable
    );

    /// @notice A member, or manager on behalf of a member, transfers a deposit
    /// portion to another address. Manager-initiated transfers can only
    /// occur on modifiable syndicates.
    /// @dev `actor` is used to differentiate between who is triggering the
    /// event emission. Current options are "member" and "manager", but more
    /// may be introduced (e.g. "integration").
    event DepositTransferred(
        address indexed syndicateAddress,
        address indexed memberAddress,
        address indexed targetAddress,
        uint256 amount,
        string actor
    );

    // Functions----------------------------------------------------------------

    /// @notice Used by a manager to change the transferability of a Syndicate.
    /// @param syndicateAddress The address of the Syndicate
    /// @param transferable The new value of transferability
    function managerSetTransferable(address syndicateAddress, bool transferable)
        public
        override
        onlyManager(syndicateAddress)
        onlyBeforeDistributing(syndicateAddress)
    {
        store.setTransferable(syndicateAddress, transferable);

        emit TransferableUpdated(syndicateAddress, transferable);
    }

    /// @notice Manager transfer portion of member's deposit to another address.
    /// @param syndicateAddress Address of the Syndicate
    /// @param memberAddress Address of member to transfer deposits **from**
    /// @param targetAddress Address to transfer deposits **to**
    /// @param amount Amount to transfer between member and target
    function managerTransferDepositForMembers(
        address syndicateAddress,
        address memberAddress,
        address targetAddress,
        uint256 amount
    )
        public
        override
        onlyManager(syndicateAddress)
        onlyModifiable(syndicateAddress)
    {
        // if target is not on allowlist yet, add them before transferring
        if (
            store.allowlistEnabled(syndicateAddress) &&
            !store.allowlist(syndicateAddress, targetAddress)
        ) {
            store.setAllowlist(syndicateAddress, targetAddress, true);
        }

        _transferDeposit(
            syndicateAddress,
            memberAddress,
            targetAddress,
            amount,
            true
        );
    }

    /// @notice Member transfer portion of deposit to another address.
    /// @param syndicateAddress Address of the Syndicate
    /// @param targetAddress Address to transfer deposits to
    /// @param amount Amount of deposit to transfer to targetAddress
    function memberTransfer(
        address syndicateAddress,
        address targetAddress,
        uint256 amount
    )
        public
        override
        onlyNotManager(syndicateAddress)
        onlyTransferable(syndicateAddress)
    {
        _transferDeposit(
            syndicateAddress,
            msg.sender,
            targetAddress,
            amount,
            false
        );
    }

    /// @notice Transfers deposits from one address to another.
    /// @param syndicateAddress The address of the Syndicate
    /// @param originAddress The address to transfer deposits **from**
    /// @param targetAddress The address to transfer deposits **to**
    /// @param amount Amount to transfer between origin and target
    /// @dev Because this internal function can be called by both a member
    /// and a manager, we leave the event emission responsibility in their
    /// respective public functions.
    /// @dev This function does NOT call an IERC20 transfer, so the amount
    /// passed in will be exactly the amount transferred (even if the deposit
    /// token takes a fee upon IERC20 transfer).
    function _transferDeposit(
        address syndicateAddress,
        address originAddress,
        address targetAddress,
        uint256 amount,
        bool calledByManager
    )
        internal
        onlyBeforeDistributing(syndicateAddress)
        enforceAllowlist(syndicateAddress, targetAddress)
    {
        // Transfer amount cannot be 0
        require(amount > 0, "TFR<=0");

        // Origin's balance must be sufficient to cover transfer
        require(
            amount <= store.depositMember(syndicateAddress, originAddress),
            "TFR>BAL"
        );

        // Origin's new balance must either be 0 or at least depositMemberMin
        require(
            store.depositMember(syndicateAddress, originAddress) - amount ==
                0 ||
                store.depositMember(syndicateAddress, originAddress) - amount >=
                store.depositMemberMin(syndicateAddress),
            "0<BAL<MIN_MBR_DEP"
        );

        // Target's new balance must be at least depositMemberMin
        // This check must be performed even if the target had no prior
        // balance, as the depositMemberMin may have changed since the
        // origin member last deposited/withdrew.
        require(
            store.depositMember(syndicateAddress, targetAddress) + amount >=
                store.depositMemberMin(syndicateAddress),
            "0<BAL<MIN_MBR_DEP"
        );

        // Target's new balance must be at most depositMemberMax
        // This check must be performed even if the target had no prior
        // balance, as the depositMemberMax may have changed since the
        // origin member last deposited/withdrew.
        require(
            store.depositMember(syndicateAddress, targetAddress) + amount <=
                store.depositMemberMax(syndicateAddress),
            "BAL>MAX_MBR_DEP"
        );

        // If the target had no prior balance AND the origin will still have a
        // balance after the transfer, the number of members will increase.
        if (
            store.depositMember(syndicateAddress, targetAddress) == 0 &&
            store.depositMember(syndicateAddress, originAddress) - amount != 0
        ) {
            require(
                store.numMembersCurrent(syndicateAddress) <
                    store.numMembersMax(syndicateAddress),
                "MAX_MBRS_REACHED"
            );

            store.setNumMembersCurrent(
                syndicateAddress,
                store.numMembersCurrent(syndicateAddress) + 1
            );
        }
        // If the target had a prior balance AND the origin will have a 0
        // balance after the transfer, the number of members will decrease.
        else if (
            store.depositMember(syndicateAddress, targetAddress) != 0 &&
            store.depositMember(syndicateAddress, originAddress) - amount == 0
        ) {
            store.setNumMembersCurrent(
                syndicateAddress,
                store.numMembersCurrent(syndicateAddress) - 1
            );
        }

        // Decrease origin address deposit holdings
        store.setDepositMember(
            syndicateAddress,
            originAddress,
            store.depositMember(syndicateAddress, originAddress) - amount
        );

        // Increase target address deposit holdings
        store.setDepositMember(
            syndicateAddress,
            targetAddress,
            store.depositMember(syndicateAddress, targetAddress) + amount
        );

        string memory actor = calledByManager ? "manager" : "member";

        emit DepositTransferred(
            syndicateAddress,
            originAddress,
            targetAddress,
            amount,
            actor
        );
    }
}

